window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling author Deanna Chase. </p> <p>Newlyweds Jade Calhoun and Kane Rouquette have barely said “I do” when there’s a disturbance in the shadow world that’s draining the energy of angels. As shadow walkers, Jade and Kane are pressed into service, tasked with the impossible mission of solving the mystery before any angels are lost...until Kane’s accused of poisoning the shadows with his incubus energy and his power is stripped. </p> <p>Life goes from bad to worse when a lesser goddess shows up, hell-bent on stealing the spirits of mortals in pursuit of a fountain of youth. Now it’s up to Jade and her coven to keep their friends safe, clear Kane’s name, and fix the shadows before one of them is lost forever. </p>"; 
